BrawSimResults <- if (requireNamespace("jmvcore", quietly=TRUE)) R6::R6Class(
    "BrawSimResults",
    inherit = jmvcore::Group,
    active = list(
        simSystemHTML = function() private$.items[["simSystemHTML"]],
        debug = function() private$.items[["debug"]],
        simGraphHTML = function() private$.items[["simGraphHTML"]],
        simGraph = function() private$.items[["simGraph"]],
        simReport = function() private$.items[["simReport"]],
        sendSample = function() private$.items[["sendSample"]],
        sendMultiple = function() private$.items[["sendMultiple"]],
        sendExplore = function() private$.items[["sendExplore"]]),
    private = list(),
    public=list(
        initialize=function(options) {
            super$initialize(
                options=options,
                name="",
                title="BrawStats:Simulate Data",
                refs=list(
                    "brawstats",
                    "book"))
            self$add(jmvcore::Html$new(
                options=options,
                name="simSystemHTML",
                visible=TRUE))
            self$add(jmvcore::Preformatted$new(
                options=options,
                name="debug",
                visible=FALSE))
            self$add(jmvcore::Html$new(
                options=options,
                name="simGraphHTML",
                visible=TRUE,
                clearWith=NULL))
            self$add(jmvcore::Image$new(
                options=options,
                name="simGraph",
                title=" ",
                width=550,
                height=400,
                visible=FALSE,
                renderFun=".plotSimGraph",
                clearWith=list(
                    "makeSampleBtn",
                    "showSampleType",
                    "showInferParam",
                    "inferVar1",
                    "inferVar2",
                    "reportInferStats",
                    "showInferDimension",
                    "makeMultipleBtn",
                    "showMultipleParam",
                    "showMultipleDimension",
                    "makeExploreBtn",
                    "showExploreParam",
                    "showExploreDimension",
                    "showExploreStyle",
                    "whichShowMultiple",
                    "MetaAnalysisType",
                    "MetaAnalysisMethod",
                    "MetaAnalysisPrior",
                    "MetaAnalysisBias",
                    "MetaAnalysisNulls",
                    "simGoBack",
                    "simGoForwards")))
            self$add(jmvcore::Html$new(
                options=options,
                name="simReport",
                visible=FALSE))
            self$add(jmvcore::Output$new(
                options=options,
                name="sendSample",
                measureType="nominal",
                varTitle="Sample",
                items=4,
                clearWith=list(
                    "makeSampleBtn")))
            self$add(jmvcore::Output$new(
                options=options,
                name="sendMultiple",
                measureType="continuous",
                varTitle="Mult",
                items=4,
                clearWith=list(
                    "makeMultipleBtn")))
            self$add(jmvcore::Output$new(
                options=options,
                name="sendExplore",
                measureType="continuous",
                varTitle="Explore",
                items=5,
                clearWith=list(
                    "makeExploreBtn")))}))

BrawSimBase <- if (requireNamespace("jmvcore", quietly=TRUE)) R6::R6Class(
    "BrawSimBase",
    inherit = jmvcore::Analysis,
    public = list(
        initialize = function(options, data=NULL, datasetId="", analysisId="", revision=0) {
            super$initialize(
                package = "BrawStats",
                name = "BrawSim",
                version = c(1,0,0),
                options = options,
                results = BrawSimResults$new(options=options),
                data = data,
                datasetId = datasetId,
                analysisId = analysisId,
                revision = revision,
                pause = NULL,
                completeWhenFilled = FALSE,
                requiresMissings = FALSE,
                weightsSupport = 'na')
        }))

